Dolly Parton is one of the world's great superstars, 
feted for her figure as much as for her music. Platinum 
Blonde goes inside her world to discover the woman under 
the wigs as she returned to the concert stage in the UK 
in 2002 after an absence of 20 years. Born into grinding 
poverty in rural Tennessee, Dolly has risen to the top of
her tree in music, films and as a businesswoman who owns 
her own theme park.

Friends, family and colleagues - including Lily Tomlin
Kenny Rogers, Billy Connolly, Dabney Coleman and 
Alison Krauss - help tell her story, along with the full 
and frank views of Dolly herself. With cameo appearances 
from Sinead O'Connor, Norah Jones, Jonathan Ross and 
Terry Wogan

